import {
    makeStyles,
    Container,
    Typography,
    TextField,
    Button,
    Box,
  } from "@mui/material";
import { useState } from "react";

  /*const useStyles = makeStyles((theme) => ({
    heading: {
      textAlign: "center",
      margin: theme.spacing(1, 0, 4),
    },
    submitButton: {
      marginTop: theme.spacing(4),
    },
  }));*/

export default function Register(){

    //const { heading, submitButton } = useStyles();

    const [json, setJson] = useState<string>();


    return (
        <Container maxWidth="xs" sx={{border: 1, marginTop: 10, paddingBottom: 15, backgroundcolor:'#F8F8F8'}}>
        <Typography  variant="h3">
          Registro
        </Typography>
        <form color="red">
          <TextField
            variant="outlined"
            margin="normal"
            label="Email"
            fullWidth
            required
          />
          <TextField
            variant="outlined"
            margin="normal"
            label="First Name"
            fullWidth
            required
          />
          <TextField
            variant="outlined"
            margin="normal"
            label="Password"
            type="password"
            fullWidth
            required
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"

          >
            Registrar
          </Button>
          {json && (
            <>
              <Typography variant="body1">
                Below is the JSON that would normally get passed to the server
                when a form gets submitted
              </Typography>
              <Typography variant="body2">{json}</Typography>
            </>
          )}
        </form>
      </Container>
      );
}
